from string import ascii_lowercase
trans = str.maketrans(ascii_lowercase, "bcdEfghIjklmnOpqrstUvwxyzA")

def changer(string):
    return string.lower().translate(trans)

from string import ascii_lowercase as al

xs = ''.join(c.upper() if c in 'aeiou' else c for c in al) * 2
tbl = str.maketrans(al + al.upper(), xs[1:] + xs[0])
def changer(s):
    return s.translate(tbl)

import re
def changer(st):
    st = st.lower().translate(st.maketrans('abcdefghijklmnopqrstuvwxyz','bcdefghijklmnopqrstuvwxyza'))
    return re.sub('[aeiou]',lambda m: m.group().upper(),st)

